import TopBar from '../Components/TopBar'
import MyCarousel from '../Components/MyCarousel'


class Home extends Component {

    componentDidMount() {
        M.AutoInit()
    }

    render() {
        return (
            <div>
                <TopBar />
                <MyCarousel/>
                {/* <MyCard/>
